export default function setItem(item) {
    return fetch('http://localhost:3333/person', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(item) 
    })
    .then((response) => response.json())
    .then((json) => console.log(json));
   }
